    runTests :: [(String, String, (Either String (Integer, Integer)))] -> ([(String, Bool)], (Integer, Integer))
    runTests tests = f tests ([],(0,0))
        where
            f :: [(String, String, (Either String (Integer, Integer)))] -> ([(String, Bool)], (Integer, Integer)) -> ([(String, Bool)], (Integer, Integer))
            f [] (acc,(passed, total)) = (acc,(passed, total))
            f ((n,d,r):t) (acc,(passed, total)) = 
                let
                    isPassed = (score d) == r
                    rez = (n, isPassed)
                in
                    f t ((rez : acc),(if isPassed then passed+1 else passed,total+1))
